import axios from 'axios';

export const fetchHomeData = () => {
  return (dispatch) => {
    axios.get('http://localhost:9361/post/panel')
      .then((response) => {
        dispatch({ type: 'Home', payload: response.data });
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  };
};
